def price_down_data_2(csv):
    csv = csv.split('__')
    kr = csv[0].split('_')
    full_text = ''
    for i, v in enumerate(kr):
        some_string = str(str(v).encode('UTF-16be').hex())
        if len(kr) - 1 != i:
            full_text = full_text + some_string + '_'
        else:
            full_text = full_text + some_string

    full_text = full_text.split('_')
    uni_text = ''
    for i, v in enumerate(full_text):
        x = 4
        res = '\\u' + '\\u'.join([v[y - x:y] for y in range(x, len(v) + x, x)])
        print(res)
        if len(full_text) - 1 != i:
            uni_text = uni_text + res + '_'
        else:
            uni_text = uni_text + res

    csv = uni_text + '__' + str(csv[1]) + '__' + str(csv[2])
    print(''.join(list(csv)))
    return csv

